import React from 'react';
import {observer} from 'mobx-react';
import store from './store';


function App() {
  return (
    <div className="App">
      {
        <h1>{store.value}</h1>
      }
      <button onClick={()=>store.why} >why</button>
      <button onClick={()=>store.sum}>+</button>
    </div>
  );
}

export default observer(App);
